import React from "react";

import { UserAddOutlined } from "@ant-design/icons";
import UserAccounts from "../userAccounts/userAccounts";
import "./sideBar.scss";
export default function SideBar() {
  const testtDatta = [
    {
      name: "King",
      account: "twitter",
      accountId: "yo mama",
    },
    {
      name: "Bovi",
      account: "twitter",
      accountId: "yo mama",
    },
    {
      name: "uncoolOj",
      account: "twitter",
      accountId: "yo mama",
    },
    {
      name: "the_real_bastard101",
      account: "twitter",
      accountId: "yo mama",
    },
  ];
  return (
    <div className="sidebar">
      <div className="top">
        <div className="user-top-card">
          <div className="circle"></div>

          <div className="info">
            <p>King Somto</p>
          </div>
        </div>

        <div className="account-list">
          {testtDatta.map((data) => {
            return <UserAccounts {...data} />;
          })}
        </div>
      </div>
      <div className="footer">
        <button>
          <UserAddOutlined /> Add a social acount
        </button>
      </div>
    </div>
  );
}
